import React from 'react'
import classes from './Layout.module.css'
import Toolbar from '../Navigation/Toolbar/Toolbar'

const layout = (props) => (
    <React.Fragment className={classes.Content}>
        <Toolbar></Toolbar>        
        <main >
            {props.children}
        </main>
    </React.Fragment>
);

export default layout;
